67698693 67698689 67698691 67698693 67698689 67698691 67698693;} @list l0:level1 	{mso-level-start-at:0; 	mso-level-number-format:bullet; 	mso-level-text:-; 	mso-level-tab-stop:36.0pt; 	mso-level-number-position:left; 	text-indent:-18.0pt; 	font-family:"Times New Roman"; 	mso-fareast-font-family:"Times New Roman";} ol 	{margin-bottom:0cm;} ul 	{margin-bottom:0cm;} --> <!--[if gte mso 10]> <style>  /* Style Definitions */  table.MsoNormalTable 	{mso-style-name:"Table Normal"; 	mso-tstyle-rowband-size:0; 	mso-tstyle-colband-size:0; 	mso-style-noshow:yes; 	mso-style-parent:""; 	mso-padding-alt:0cm 5.4pt 0cm 5.4pt; 	mso-para-margin:0cm; 	mso-para-margin-bottom:.0001pt; 	mso-pagination:widow-orphan; 	font-size:10.0pt; 	font-family:"Times New Roman"; 	mso-ansi-language:#0400; 	mso-fareast-language:#0400; 	mso-bidi-language:#0400;} </style> <![endif]--></p><p>&nbsp;</p><p style="line-height: 150%" class="MsoNormal"><strong><span style="font-size: 16pt; line-height: 150%">Công ty cổ phần thương mại và dịch vụ viễn thông Hoàng Linh</span></strong></p>  <p style="line-height: 150%" class="MsoNormal"><em><span style="font-size: 18pt; line-height: 150%">Cần tuyển</span></em><span style="font-size: 18pt; line-height: 150%"> : 3 Nhân viên</span></p>  <p style="margin-left: 36pt; text-indent: -18pt; line-height: 150%" class="MsoNormal"><!--[if !supportLists]--><span style="font-size: 18pt; line-height: 150%"><span>-<span style="font-family: ''Times New Roman''; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal">        </span></span></span><!--[endif]--><span style="font-size: 18pt; line-height: 150%">2 Nhân viên giao dịch</span></p>  <p style="margin-left: 36pt; text-indent: -18pt; line-height: 150%" class="MsoNormal"><!--[if !supportLists]--><span style="font-size: 18pt; line-height: 150%"><span>-<span style="font-family: ''Times New Roman''; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal">        </span></span></span><!--[endif]--><span style="font-size: 18pt; line-height: 150%">1 Nhân viên kế toán</span></p>  <p style="line-height: 150%" class="MsoNormal"><em><span style="font-size: 18pt; line-height: 150%">Làm việc tại</span></em><span style="font-size: 18pt; line-height: 150%"> : Mobifone Hoàng Linh số 2 tổ 3 thị trấn Đông Anh Hà Nội</span></p>  <p style="line-height: 150%" class="MsoNormal"><em><span style="font-size: 18pt; line-height: 150%">Yêu cầu</span></em><span style="font-size: 18pt; line-height: 150%"> : Tốt nghiệp cao đẳng, trung cấp trở lên, thành thạo word, Excel máy tính văn phòng,ngoại hình ưa nhìn,giao tiếp tốt</span></p>  <p style="line-height: 150%" class="MsoNormal"><em><span style="font-size: 18pt; line-height: 150%">Ưu tiên</span></em><span style="font-size: 18pt; line-height: 150%"> : Những người có kinh nghiệm trong nghề kinh doanh</span></p>  <p style="line-height: 150%" class="MsoNormal"><em><span style="font-size: 18pt; line-height: 150%">Mức lương</span></em><span style="font-size: 18pt; line-height: 150%"> : Từ 2,5 Triệu đến 4 triệu,chế độ nghỉ lễ tết hưởng theo quy định của nhà nước</span></p>  <p style="line-height: 150%" class="MsoNormal"><em><span style="font-size: 18pt; line-height: 150%">Liên hệ</span></em><span style="font-size: 18pt; line-height: 150%"> : Mr Linh 0989.991199 & 01268.288888. <u>www.simdonganh.net</u></span></p>  <p style="line-height: 150%" class="MsoNormal"><span style="font-size: 18pt; line-height: 150%">Hồ sơ nộp tại số 2 tổ 3 đường Cao lỗ thị trấn đông anh Hà nội</span></p>  <p>&nbsp;</p><p> II&gt;</p><p>&nbsp;</p><p><strong><font size="3">Công ty cổ phần thương mại và dich vụ viễn thông Hoàng Linh<br /><br />Cần tuyển : Cộng tác viên làm việc cho mobifone tại Đông anh<br /><br />Công việc : Tư vấn khách hàng sử dụng trả sau mạng Mobifone ( dựa trên chương trình khuyến mại cực khủng của Mobifone và list hàng vạn số đẹp trong kho của chúng tôi )<br /><br />Thời gian làm việc : Bán thời gian , ưu tiên sinh viên hoc sinh làm thêm, và các bạn làm nhiều công ty cùng lúc.Các bạn có thể đến trực tiếp công ty hoặc online qua mạng<br /><br />Hoa hồng : 1 Khách hàng sử dụng số của mobi các bạn được trả 70.0000đ ( 1 tháng cố gắng làm 100s thui)<br /><br />Điều kiện : Ít nhât đạt trên 10 số , khách hàng phải sử dụng và thanh toán cước 2 tháng đầu<br /><br />Dùng trả sau phí thuê bao 49.000 đồng/ 1 tháng<br /><br />Khuyến mại cho khách hàng<br />Được lựa trọn sim số đẹp theo yêu cầu trong hàng vạn số đẹp trong kho số của chúng tôi</font></strong></p><p><strong><font size="3"><br /><font color="#0000ff">KM1 : </font><font color="#0000ff">Mỗi tháng tặng 100.000 tiền cước sử dụng trong suốt 12 tháng cả nội mạng và ngoại mạng ( Bỏ ra 50k mà tháng nào cũng được tặng 100k)</font></font></strong></p><p><strong><font size="3"><font color="#0000ff"><br /></font><font color="#0000ff">KM2 : Đóng thêm 25k được gọi miễn phí 10p'' tất cả các cuộc gọi nội mạng trong 12 tháng.</font></font></strong><br /><strong> </strong><br /><strong>Tiền thuê bao mỗi tháng là 49k </strong><br /><strong><font size="3"><br />Thời gian khuyến mại : 05/08/2010 đến 20/08/2010 cơ hội kéo dài trong 15 ngày,nhanh tay nào<br /><br />Mọi thắc mắc xin liên hệ : Mr Linh 01268288888 0989 991199 </font></strong></p>', '', 1, 0, 0, 0, '2009-03-23 18:02:11', 62, '', '2010-09-04 12:11:41', 68, 0, '0000-00-00 00:00:00', '2009-03-23 18:02:11', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 29, 0, 2, '', '', 0, 3672, 'robots=\nauthor='),
